297896767	246037407	47836635	364846007	115997801	10341110	1642094893	undefined	{1953129668}	{1816416714,977887528}	\N	Боярка	2016-03-01	1	\N	100000.00	Donec ac finibus eros, ac vehicula eros. Sed vel rhoncus nunc. Nulla rhoncus semper orci sit amet eleifend. In ac felis at tellus vehicula varius. Suspendisse potenti. Maecenas quis nisi id nulla semper posuere eu at justo. Aliquam rutrum cursus finibus. Nulla at risus nec tellus iaculis tristique. Aenean sapien mi, consectetur ac elit nec, fermentum ullamcorper ex. Donec ornare aliquam vestibulum. Fusce faucibus eu erat ut pretium. Vivamus dui velit, aliquam sed feugiat ut, pretium in mauris.	{/original/urn-Document-Contract-BW-297896767/10994069_10205784682076770_3965495420606387376_n-8913915.jpg}	<p><strong>Товариство з обмеженою відповідальністю “ХФК “Біокон”</strong>, що здійснює декларування на підставі ліцензії про посередницьку діяльність митного брокера <strong>№ 521279 серія АE від  25.07.2014 року</strong>, внесене до реєстру митних складів  <strong>№ M/0051/V/02 від 20.02.2014 року</strong> та дозволу на право використання складського приміщення <strong>№ S/0042/V/01 від 20.02.2014 року</strong>, (далі <strong>-</strong> «ВИКОНАВЕЦЬ») в особі Директора Павлової Віри Валеріївни, що діє на підставі Статуту, з одного боку, і  <strong> ООО САНОФИ </strong> (далі – «ЗАМОВНИК»),  що є юридичною особою, створене та діє за законодавством України, в особі директора Самойлов С.С., який діє на підставі Статуту, з іншого боку, уклали цей Договір про наступне:</p>	<ol><li>ЗАМОВНИК доручає, а ВИКОНАВЕЦЬ зобов’язується:</li>\n</ol><ul><li>за обумовлений термін надавати послуги по декларуванню вантажу, (далі ВАНТАЖ) ЗАМОВНИКА, що оформлюється на МС “Біокон” (далі МС) та СТЗ “Біокон” (далі СТЗ) чи випускаються з нього в адресу ЗАМОВНИКА, надавати інші, пов’язані з діяльністю ЗАМОВНИКА послуги;</li>\n<li>особисто здійснювати дії, пов’язані з декларуванням та митним оформленням ВАНТАЖУ здійснювати від свого імені за рахунок і за дорученням ЗАМОВНИКА в порядку, передбаченим цим Договором та чинним законодавством України;</li>\n<li>зберігати ВАНТАЖ при їх оформленні на МС та на СТЗ;</li>\n<li>за окремим дорученням ЗАМОВНИКА  та у межах, дозволених законодавством України, надавати будь-які додаткові послуги, включаючи, але не обмежуючись, інспектування ВАНТАЖУ, його контролювання, митне оформлення повернутого ВАНТАЖУ тощо.</li>\n</ul>	<ol><li>Обов’язки ВИКОНАВЦЯ:\n<ol><li>Здійснювати декларування ВАНТАЖІВ та їх митне оформлення у встановленому чинним законодавством та нормативними документами порядку;</li>\n<li>Правильно нараховувати митні платежі;</li>\n<li>Зберігати комерційну таємницю, яка міститься в документах ЗАМОВНИКА;</li>\n<li>Інформувати  ЗАМОВНИКА щодо вимог митного законодавства України, знайомити його при необхідності з цими документами, попереджувати ЗАМОВНИКА про встановлені заборони чи обмеження щодо розпорядження ВАНТАЖІВ у випадках, якщо митне оформлення не завершено;</li>\n<li>При необхідності оформлювати та зберігати ВАНТАЖ на МС та на СТЗ.</li>\n</ol></li>\n<li>ВИКОНАВЕЦЬ має право:\n<ol><li>Запитувати у ЗАМОВНИКА документи, необхідні для митного оформлення ВАНТАЖУ</li>\n<li>Здійснювати контроль за своєчасною і повною сплатою митних платежів ЗАМОВНИКА</li>\n</ol></li>\n<li>Незважаючи на положення п. 2.1.4, відмовити ЗАМОВНИКУ у наданні послуг по декларуванню за конкретними операціями у випадку, коли у ВИКОНАВЦЯ є достатні підстави вважати, що документи містять заздалегідь неправдиві відомості та/або дії ВИКОНАВЦЯ нестимуть протиправний характер чи будуть суперечити встановленому порядку, а також якщо ЗАМОВНИК не подає заявку та/або необхідні для оформлення документи;</li>\n<li>Незважаючи на положення п. 2.1.4, ВИКОНАВЕЦЬ вправі відмовити в декларуванні ВАНТАЖУ ЗАМОВНИКУ також у випадках, коли в наданих ЗАМОВНИКОМ документах існують істотні помилки, або вони складені без додержання вимог чинних нормативних документів. В таких випадках декларування може бути здійснено після усунення вказаних недоліків та помилок.</li>\n<li>Обов’язки ЗАМОВНИКА:\n<ol><li>До початку митного оформлення кожної партії вантажів надавати ВИКОНАВЦЮ доручення-заявку на декларування ВАНТАЖІВ та всі необхідні для митного оформлення документи;</li>\n<li>В необхідних випадках надавати уповноваженій особі ВИКОНАВЦЯ доручення на виконання окремих функцій від імені ЗАМОВНИКА;</li>\n<li>Забезпечити сплати митних платежів згідно з розділом 4 цього Договору;</li>\n</ol></li>\n<li>Документообіг та обов’язки сторін щодо безпосереднього митного оформлення.\n<ol><li>ВИКОНАВЕЦЬ отримує (не пізніше, ніж за 2 робочих дні до моменту відправлення  ВАНТАЖУ) від ЗАМОВНИКА копії наступних супроводжуючих документів з метою отримання Попередньої Декларації (Попереднього Повідомлення):\n<ul><li>Вхідний рахунок;</li>\n<li>Пакувальний лист;</li>\n<li>Сертифікати якості;</li>\n<li>Сертифікат походження;</li>\n</ul></li>\n<li>Не пізніше моменту передачі ВІДПРАВНИКОМ ВАНТАЖУ першим вантажоперевізником, ВИКОНАВЕЦЬ отримує від ЗАМОВНИКА копію транспортної накладної. Без надання цього документа оформлення Попередньої Декларації (Попереднього Повідомлення) неможливе.</li>\n<li>Не пізніше ніж за 24 робочих години після отримання супроводжуючих документів ВИКОНАВЕЦЬ отримує від митних органів Попередню Декларацію (Попереднього Повідомлення), номер якої повідомляє  ЗАМОВНИКУ.</li>\n<li>Наступні товаросупровідні документи слідують з вантажем та мають бути надані ВИКОНАВЦЮ не менш ніж за 24 години до отримання відповідної Продукції:\n<ul><li>Транспортна накладна;</li>\n<li>Вхідний рахунок;</li>\n<li>Пакувальний лист;</li>\n<li>Сертифікат аналізу;</li>\n<li>Сертифікат походження.</li>\n<li>При отриманні документів ВИКОНАВЕЦЬ перевіряє  їх відповідність з подорожнім листом та реєстром.</li>\n</ul></li>\n</ol></li>\n</ol>	<ol><li>Термін виконання послуг ВИКОНАВЦЕМ залежить від обсягу, зазначеного у заявці ЗАМОВНИКА, графіку роботи митниці, тощо та погоджується Сторонами окремим письмовим документом.</li>\n<li>Звичайний термін виконання послуг становить 3-5 робочих днів з моменту отримання останніх дозволів митниці   при необхідності та з урахуванням п.3.1. цього Договору.</li>\n<li>3.3. В разі потреби ЗАМОВНИКА у негайному, тобто протягом 1-2 робочих днів, виконанні замовлених послуг він зазначає це в заявці з поміткою “Терміново”. Вартість послуг ВИКОНАВЦЯ в цьому випадку при узгодженні сторонами, збільшується на 30-50% .</li>\n</ol>	<ol><li>Митні платежі мають бути сплачені ЗАМОВНИКОМ шляхом передплати на рахунок митного органу до митного оформлення ВАНТАЖІВ.</li>\n<li>Якщо сплату митних платежів на рахунки митниці здійснює ВИКОНАВЕЦЬ, ЗАМОВНИК повертає суму сплачених митних платежів ВИКОНАВЦЮ протягом 3-х банківських днів після митного оформлення ВАНТАЖІВ, або в разі значних сум, які повинні бути сплачені на рахунки митниці, ЗАМОВНИК здійснює авансову оплату (у розмірі 50-100%) митних платежів для покриття видатків, пов’язаних з перерахуванням цих платежів на рахунки митниці. В разі встановлення згодом недобору митних платежів, що виникло не з вини ВИКОНАВЦЯ (зміна ставок митних зборів чи розміру інших митних платежів, вимог нормативних документів та інше) відповідальність за їх доплату несе ЗАМОВНИК.</li>\n<li>Всі платежі, що здійснюються ЗАМОВНИКОМ згідно з цією статтею, здійснюватимуться за умови надання ВИКОНАВЦЕМ документів, що підтверджують розрахунок сум відповідно до законодавчих вимог.</li>\n</ol>	<ol><li>За надання послуг по митному оформленню ВАНТАЖІВ, ЗАМОВНИК виплачує ВИКОНАВЦЮ суму, розмір якої залежить від обсягу виконаних робіт та наданих послуг. Розрахунок цього розміру здійснюється згідно з тарифами ВИКОНАВЦЯ,  що є Додатком №1 до цього Договору  і є невід’ємною частиною Договору.</li>\n<li>Сплата послуг проводиться ЗАМОВНИКОМ на підставі виставлених рахунків ВИКОНАВЦЯ. Оплата послуг ВИКОНАВЦЯ здійснюється - по факту наданих послуг за безготівковим розрахунком, шляхом переказу коштів на поточний рахунок ВИКОНАВЦЯ - не пізніше 10 банківських днів з моменту отримання рахунку ЗАМОВНИКОМ. Моментом надання послуг є завершення митного оформлення Товарів ЗАМОВНИКА. Датою оплати вважається дата надходження коштів на поточний рахунок ВИКОНАВЦЯ.</li>\n<li>Факт надання послуг підтверджується Актом прийому-передачі наданих послуг, що оформлюється у двох екземплярах, по одному для кожної сторони, та підписується повноважними представниками сторін і скріплюється печатками сторін протягом 2-х робочих днів з моменту отримання рахунку ЗАМОВНИКОМ. Підписання Акту прийому-передачі наданих послуг ЗАМОВНИКОМ є підтвердженням відсутності претензій щодо наданих послуг.</li>\n</ol>	<ol><li>Сторони несуть юридичну відповідальність за невиконання або неналежне виконання умов цього Договору.</li>\n<li>ЗАМОВНИК несе повну юридичну відповідальність за достовірність даних, зазначених ним в заявці-дорученні та в документах, що додаються до неї.</li>\n<li>За умови що ВИКОНАВЕЦЬ повністю та належним чином виконує свої зобов’язання за цим Договором, він не несе відповідальності за зобов’язання ЗАМОВНИКА, які останній дав безпосередньо митниці. Так само ВИКОНАВЕЦЬ не несе відповідальності за перевищення узгоджених термінів оформлення ВАНТАЖІВ ЗАМОВНИКА у випадках, якщо таке перевищення сталося у зв’язку з нездійсненням або несвоєчасним здійсненням ЗАМОВНИКОМ тих заходів, які він повинен був і міг здійснити згідно з встановленим порядком і цим Договором, або документи чи ВАНТАЖ будуть надіслані на необхідні митні перевірки та експертизи.</li>\n<li>ЗАМОВНИК несе відповідальність в разі несвоєчасної передачі ВИКОНАВЦЮ відомостей, документів, необхідних для виконання його функцій.</li>\n<li>ВИКОНАВЕЦЬ несе відповідальність  в розмірі фактичних збитків ЗАМОВНИКА за неналежне зберігання ВАНТАЖІВ на МС або на СТЗ до їх випуску зі складу,  у випадку якщо встановлено, що вказані збитки стались з  вини ВИКОНАВЦЯ.</li>\n<li>У випадку порушення ВИКОНАВЦЕМ термінів надання послуг, ВИКОНАВЕЦЬ сплачує ЗАМОВНИКУ неустойку з розрахунку подвійної облікової ставки НБУ, яка діяла в період прострочення, від вартості несвоєчасно виконаних послуг, за кожен день прострочення.</li>\n</ol>	<ol><li>У випадках, не передбачених цим Договором, сторони керуються чинним законодавством України. При виникненні суперечок, що не можуть бути вирішені сторонами за взаємною згодою, дані суперечки вирішуються в судовому порядку у відповідності з чинним законодавством України.</li>\n<li>Договір набирає юридичну силу з моменту підписання його сторонами  та скріплення печатками сторін і діє до 31.12.201__ року.</li>\n<li>Договір може бути розірваний достроково за взаємної письмової згоди сторін.</li>\n<li>Кожна зі Сторін має право припинити дію цього Договору в односторонньому порядку, направивши попереднє письмове повідомлення іншій Стороні за три місяці до такого припинення, у випадку суттєвого порушення іншою Стороною будь-якого з її зобов’язань за цим Договором, яке не було виправлене протягом тридцяти (30) днів після відправлення їй повідомлення про відповідне порушення. <br />У випадку припинення дії цього Договору (з будь-якої причини чи наміру) або у разу закінчення терміну дії Договору, кожна Сторона повинна оплатити несплачені рахунки, отримані від іншої Сторони протягом чотирнадцяти (14) днів.<br />У випадку необхідності розірвання договору в той час, коли товар ЗАМОВНИКА знаходиться на МС/СТЗ ВИКОНАВЦЯ, за згодою Сторін, або ВИКОНАВЕЦЬ має надати послуги з митного декларування та оформлення даного товару, або ЗАМОВНИК вивозить товар, що не пройшов митне декларування та оформлення  з МС/СТЗ. В будь-якому випадку дія даного Договору може бути припинена тільки після виконання Сторонами взятих на себе зобов'язань.</li>\n<li>ВИКОНАВЕЦЬ та ЗАМОВНИК погоджуються з тим, що під час виконання цього Договору сторони розкривають, передають та користуються певною інформацією, яка визначається як конфіденційна. Для цілей цього Договору термін "Конфіденційна інформація" означає будь-яку інформацію, яка стала відомою ВИКОНАВЦЮ внаслідок виконання зобов’язань за цим Договором або отримана будь-яким іншим способом, яка не є загальнодоступною в галузі діяльності ЗАМОВНИКА. ВИКОНАВЕЦЬ зобов’язується на протязі дії цього Договору не використовувати в цілях, не пов’язаних із виконанням зобов’язань за цим Договором, прямо або опосередковано, не розголошувати, не публікувати та не передавати третім особам будь-яку Конфіденційну інформацію ЗАМОВНИКА.</li>\n<li>Уповноважені особи Сторін, які підписують Договір, згідно Закону України «Про захист персональних даних» дають цим згоду на обробку їх персональних даних, які містять у Договорі (в т.ч. у доповненнях до нього, документах, які підтверджують їх повноваження та документах, які впливають на їх виконання), наприклад, паспортні дані та ідентифікаційний код. Уповноважені особи Сторін проінформовані про включення їх персональних даних до відповідних баз даних, власниками яких є Сторони Договору, ціллю яких є здійснення господарської діяльності Сторін. Уповноважені особи Сторін цим підтверджують, що вони повідомлені про права,  які їм належать згідно Статті 8 Закону України «Про захист персональних даних». Вказана вище інформація може передаватися третім особам тільки у випадках,  прямо передбачених законодавством.</li>\n<li>Даний Договір складено у двох примірниках українською мовою, по одному для кожної із Сторін. Обидва примірники мають однакову юридичну силу.</li>\n</ol>	BW-254973	Vising	UPN:DMS:Contracts:Contract:5434310	\N	{}	\N	urn:Actor:User:System:1	\N	f	f	f	f	t	\N	1456664581	1456664581	{urn:Management:Post:Individual:1118804000,urn:Management:Post:Individual:1816416714}	\N	186734044	\N	\N	\N	\N
