619718955	246037407	47836635	364846007	115997801	10341110	1642094893	undefined	{745206260,1813907012}	{1118804000,977887528}	\N	Александровка	2016-03-01	2	\N	70000.00	Donec ac finibus eros, ac vehicula eros. Sed vel rhoncus nunc. Nulla rhoncus semper orci sit amet eleifend. In ac felis at tellus vehicula varius. Suspendisse potenti. Maecenas quis nisi id nulla semper posuere eu at justo. Aliquam rutrum cursus finibus. Nulla at risus nec tellus iaculis tristique. Aenean sapien mi, consectetur ac elit nec, fermentum ullamcorper ex. Donec ornare aliquam vestibulum. Fusce faucibus eu erat ut pretium. Vivamus dui velit, aliquam sed feugiat ut, pretium in mauris.	{/original/urn-Document-Contract-LOP-619718955/12794478_574379002724557_2475743878234406571_n-1928151.jpg}	<p><strong>Товариство з обмеженою відповідальністю “ХФК «Біокон”</strong>, що є платником податку на прибуток на загальних умовах, далі - ОРЕНДОДАВЕЦЬ, в особі  директора Павлової В. В., яка діє на підставі Статуту, з однієї сторони, та</p>\n<p><strong>__________________ «______________»</strong>, далі - ОРЕНДАР, в особі директора _______________, який діє на підставі Статуту, з іншої сторони, а при згадуванні разом – Сторони, уклали Цей Договір про нижченаведене:</p>	<ol><li>Приміщення, що орендується, повинно бути передане ОРЕНДОДАВЦЕМ та прийняте ОРЕНДАРЕМ не пізніше 3-х календарних днів з моменту підписання Договору.</li>\n<li>При передачі приміщення, що орендується, складається акт приймання – передачі нежилих приміщень, який підписується Сторонами.</li>\n<li>Приміщення, що орендується, вважається передане в оренду з дати підписання акта приймання – передачі нежилих приміщень.</li>\n</ol>	<ol><li>Термін дії оренди нежилих приміщень  з ___ ______ 201__ року по ___ ______2018 року.</li>\n<li>Якщо жодна із Сторін в місячний термін до закінчення цього Договору не заявить про намір його припинити, цей Договір автоматично пролонговується на новий аналогічний термін.</li>\n<li>Термін дії Договору може бути скорочений лише за двохсторонньою згодою Сторін, при умові письмового оформлення додаткової угоди та підпису її уповноваженими особами.</li>\n</ol>	<ol><li>Розмір орендної плати за приміщення, що орендується становить _______________ гривень за 1 кв. м. без ПДВ щомісячно, з урахування комунальних послуг.\n<ol><li>Загальний розмір орендної плати за приміщення, що орендується  складає _________ (_________________) гривень без ПДВ на місяць, крім того ПДВ ___________ (________________) всього з урахуванням ПДВ ________ (___________________) на місяць.</li>\n</ol></li>\n<li>Плата за оренду Приміщень здійснюється ОРЕНДАРЕМ щомісяця за попередній місяць на підставі виставлених ООРЕНДОДАВЦЕМ рахунків, не пізніше 5 (п'яти) банківських днів з моменту отримання Орендарем рахунку, що виставляється з 1-го по 5-те число поточного місяця.</li>\n<li>Розмір орендної плати може бути переглянутий  Сторонами шляхом укладання додаткової угоди до цього Договору.</li>\n<li>Зобов'язання ОРЕНДАРЯ за сплатою орендної плати забезпечуються у вигляді завдатку в розмірі не меншому, ніж орендна плата за перший (базовий) місяць оренди.</li>\n<li>ОРЕНДАР має право вносити орендну плату наперед за будь-який термін у розмірі‚ що визначається на момент оплати.</li>\n<li>До вартості орендної плати входить 5 (п’ять) парувальних місць.</li>\n<li>Вартість комунальних послуг не входить до орендної плати.</li>\n<li>Усі витрати за користування телефонами оплачуються ОРЕНДАРЕМ самостійно.</li>\n<li>У разі припинення (розірвання) Договору оренди ОРЕНДАР сплачує орендну плату до дня повернення Приміщення та Майна за актом приймання-передавання включно.</li>\n<li>Закінчення строку дії Договору оренди не звільняє ОРЕНДАРЯ від обов'язку сплатити заборгованість за орендною платою, якщо така виникла, у повному обсязі, ураховуючи санкції.</li>\n</ol>	<ol><li>ОРЕНДОДАВЕЦЬ зобов’язаний:\n<ol><li>ОРЕНДОДАВЕЦЬ передає ОРЕНДАРЮ приміщення, що орендується, в технічно справному стані.</li>\n<li>ОРЕНДОДАВЕЦЬ має право 1 (один) раз на квартал здійснювати перевірку порядку використання ОРЕНДАРЕМ приміщення ‚ що орендується відповідно до умов Цього Договору.</li>\n<li>Забезпечувати безперешкодне використання ОРЕНДАРЕМ приміщення‚ що орендується‚ на умовах цього Договору;</li>\n</ol></li>\n<li>Орендодавець має право:\n<ol><li>Контролювати наявність, стан, напрями та ефективність використання Приміщення та Майна, переданого в оренду за цим Договором;</li>\n<li>Виступати з ініціативою щодо внесення змін до цього Договору або його розірвання;</li>\n<li>Здійснювати контроль за станом Приміщення та Майна шляхом візуального</li>\n</ol></li>\n</ol>	<ol><li>ОРЕНДАР зобов’язується:\n<ul><li>використовувати приміщення‚ що орендується ‚ за його цільовим призначенням відповідно до п.1.1.  Цього Договору;</li>\n<li>своєчасно здійснювати орендні платежі згідно з п. 4 цього Договору;</li>\n<li>сплачувати експлуатаційні платежі (відшкодування вартості електроенергії, водопостачання та водовідведення, газопостачання, обслуговування систем пожежної охорони та сигналізації, вивозу сміття) – на підставі виставлених Орендодавцем рахунків та актів приймання-передачі;</li>\n<li>утримувати приміщення ‚ що орендується‚ у повній справності;</li>\n<li>не здійснювати без письмової згоди ОРЕНДОДАВЦЯ перебудову‚ добудову та перепланування приміщення‚ що орендується;</li>\n<li>підтримувати території‚ прилеглі до приміщення‚ що орендується, в належному санітарному стані;</li>\n<li>безперешкодно допускати в приміщення ‚ що орендується‚ представників ОРЕНДОДАВЦЯ з метою перевірки його використання  відповідно до умов Цього Договору;</li>\n<li>дійснювати заходи щодо збереження приміщення, що орендується, виконувати всі вимоги протипожежної безпеки, санітарні вимоги, заходи із збереження приміщення, що орендується, проводити вентиляцію цього приміщення, нести відповідальність за протипожежну безпеку та правильність експлуатації електроосвітлюваних та опалювальних систем.</li>\n</ul></li>\n<li>ОРЕНДАР має право:\n<ul><li>– обладнати приміщення‚ що орендується‚ на власний розсуд;</li>\n<li>– здавати приміщення, що орендується у суборенду тільки з письмової згоди ОРЕНДОДАВЦЯ.</li>\n</ul></li>\n</ol>	<ol><li>Повернення ОРЕНДОДАВЦЮ приміщення‚ що орендується‚ здійснюється протягом 5-х днів з моменту закінчення терміну оренди.</li>\n<li>При передачі приміщення‚ що орендується‚ складається акт здачі-приймання‚ який підписується Сторонами.</li>\n<li>Приміщення‚ що орендується‚ вважається фактично переданим ОРЕНДОДАВЦЮ з моменту підписання акту здачі-приймання.</li>\n<li>Приміщення‚ що орендується‚ повинне бути передано ОРЕНДОДАВЦЮ у тому ж стані‚ в якому воно було передане в оренду з урахуванням нормального зносу.</li>\n<li>Здійснені ОРЕНДАРЕМ відокремлювані покращення приміщення‚ що орендується‚ є власністю ОРЕНДАРЯ.</li>\n<li>У випадку, коли ОРЕНДАР здійснив за власний рахунок та за згодою ОРЕНДОДАВЦЯ перепланування, він має право за взаємною згодою сторін на відшкодування вартості цих покращень.</li>\n</ol>	<ol><li>У разі порушення чи невиконання взятих на себе договірних зобов’язань Сторони несуть відповідальність згідно з чинним законодавством України.</li>\n<li>У випадку невиконання або неналежного виконання Сторонами зобов'язань за Договором, Сторона, з вини якої сталося таке невиконання або неналежне виконання, несе відповідальність за шкоду, заподіяну іншій Стороні внаслідок такого невиконання або неналежного виконання і зобов’язується відшкодувати іншій Стороні заподіяні цим збитки в повному обсязі, відповідно до закону, якщо інше прямо не передбачено Договором. <br />Окрім збитків, за невиконання або неналежне виконання зобов’язань Сторони зобов’язуються сплатити неустойку, виходячи з підстав, розмірів та в порядку, передбаченому Договором. <br />Сплата неустойки, збитків здійснюється шляхом переказу належних до сплати грошових коштів на вказаний в Договорі поточний банківський рахунок Сторони, на користь якої здійснюється така сплата, протягом 5 (п’яти) банківських днів з моменту одержання вимоги про сплату від іншої Сторони. Відшкодування завданих збитків та/або сплата неустойки не звільняє винну Сторону від виконання зобов’язань за Договором.</li>\n<li>У випадку прострочення сплати ОРЕНДАРЕМ орендної плати та/або інших платежів, передбачених у Договорі, ОРЕНДОДАВЕЦЬ має право стягнути з ООРЕНДАРЯ пеню у розмірі подвійної облікової ставки Національного банку України, що діяла у період, за який стягується пеня, від несплаченої суми за кожний день прострочення.<br />ОРЕНДОДАВЕЦЬ не відповідає за жодними зобов’язаннями ОРЕНДАРЯ, що можуть виникнути у Орендаря у зв’язку з орендою Приміщення перед будь-якими третіми особами.</li>\n<li>Орендодавець не несе відповідальності за шкоду, завдану Орендарю у зв’язку з:\n<ul><li>а) будь-яким пошкодженням, зникненням чи крадіжкою майна ОРЕНДАРЯ, що знаходиться у Приміщенні які стались не звини ОРЕНДОДАВЦЯ;</li>\n<li>б) перебоями в роботі комунальних мереж і наданням послуг, які, сталися не з вини Орендодавця;</li>\n<li>в) несхоронністю ООРЕНДАРЕМ свого майна, майна третіх осіб та Приміщення.</li>\n</ul></li>\n</ol>	<ol><li>Спори, що можуть виникнути між Сторонами під час виконання цього Договору, в тому числі спори, що стосуються його тлумачення, визнання його недійсним чи невиконання його умов, вирішуватимуться шляхом переговорів між Сторонами, а при неможливості вирішення спорів шляхом переговорів – у судовому порядку згідно зі встановленою законодавством України підвідомчістю і підсудністю справ.</li>\n</ol>	<ol><li>Дія обставин непереборної сили, що виникли після підписання Договору й перешкоджають належному виконанню Сторонами своїх зобов’язань повністю або частково, звільняє Сторони від відповідальності за невиконання й/або неналежне виконання ними відповідних зобов’язань за Договором до моменту ліквідації наслідків таких обставин.</li>\n<li>Обставинами непереборної сили за змістом Договору є надзвичайні обставини, настання яких не можна було передбачити в момент укладення Договору, дія яких не залежить від волі Сторін, а також дії наслідків яких при виконанні Сторонами своїх зобов’язань за Договором неможливо уникнути навіть у випадку прикладення Сторонами необхідних зусиль. Обставинами непереборної сили можуть бути, наприклад, воєнні дії, пожежі, природні катастрофи, блокади, терористичні акти, націоналізація, експропріація, обмеження в законодавстві про банківську діяльність, прийняття нових законодавчих актів, дії державних та місцевих органів влади та їх посадових осіб, істотні зміни на ринку нерухомості та фінансових послуг та інші обставини тощо, які роблять неможливим або недоцільним подальше виконання умов Договору. У такому випадку Сторони обговорюватимуть альтернативні шляхи виконання Договору.</li>\n<li>Сторона, що не може виконати свої зобов’язання за Договором, повинна без зволікання письмово сповістити іншу Сторону про настання таких обставин, їх характер й можливу тривалість з доданням необхідних документів, що підтверджують їх дію, зокрема, довідки Торгово-промислової палати України, в розумний строк. Неповідомлення про настання обставин непереборної сили позбавляє Сторону права на звільнення від відповідальності.</li>\n<li>Якщо дія обставин непереборної сили, що перешкоджають виконанню Стороною своїх зобов’язань за Договором, буде тривати більше 1 (одного) місяця, Сторони повинні погодити умови подальшого співробітництва в рамках Договору і внести відповідні зміни до Договору. Обов’язок надання доказів дії обставин непереборної сили несе Сторона, що посилається на дію таких обставин як на причину невиконання або неналежного виконання своїх зобов'язань. У випадку неузгодженості таких умов, якщо дія обставин непереборної сили буде тривати більше 3 (трьох) місяців кожна зі Сторін має право в односторонньому порядку відмовитися від виконання Договору.</li>\n</ol>	<ol><li>Цей Договір припиняється у разі:\n<ul><li>закінчення терміну на який він укладений;</li>\n<li>загибелі приміщення, що орендується.</li>\n<li>за взаємною згодою сторін згідно з п.3.2.</li>\n</ul></li>\n</ol>	<ol><li>Цей Договір укладено у двох оригінальних примірниках, які мають однакову юридичну силу по одному для кожної із Сторін.</li>\n<li>Умови Договору зберігають юридичну силу протягом всього строку дії Договору в тому числі у випадку зміни власника приміщення, що орендуються.</li>\n<li>Усі зміни, доповнення за текстом Цього Договору мають юридичну силу лише при взаємному їх посвідченні Сторонами у кожному окремому випадку.</li>\n<li>Цей Договір вступає в силу з моменту підписання акту приймання-передачі нежилих приміщень.</li>\n</ol>	<ol><li>До Цього Договору додається: додаток №1 - Акт приймання – передачі нежилих приміщень, який є його невід’ємною частиною та додаток № 2 – План орендованих приміщень.</li>\n<li>Завірена копія плану приміщення, що орендується та Свідоцтва про право власності на нерухоме майно серія CАК 136135  від 01.07.2013 р.</li>\n</ol>	\N	Configuring	UPN:DMS:Contracts:Contract:1345196	\N	{}	\N	urn:Actor:User:System:1	\N	t	f	f	f	\N	\N	1456669868	1456669868	{urn:Management:Post:Individual:1118804000,urn:Management:Post:Individual:1816416714}	\N	\N	<ol><li>ОРЕНДОДАВЕЦЬ передає, а ОРЕНДАР приймає в оренду нежиле приміщення  (далі – приміщення, що орендується) розташовані за адресою: Київська обл., Бориспільський р-н., с. Велика Олександрівка, вул. Бориспільска,  9, загальною площею _________ кв. м. (План приміщення наведено в Додатку № 2 до цього Договору).</li>\n<li>Приміщення, що орендується, належить ОРЕНДОДАВЦЮ на праві власності відповідно до Свідоцтва про право власності на нерухоме майно серія CАК 136135  від 01.07.2013 р.  (Копія Свідоцтва додається).</li>\n<li>Приміщення передається у користування виключно з метою його використання під офіс ОРЕНДАРЯ</li>\n</ol>	\N	\N	\N	\N
511791089	2059004404	2059004404	1422911556	404906315	\N	267613092	undefined	{955127074}	{1939617403}	\N	Александровка	2016-04-01	1	\N	234567890.00	Не следует, однако забывать, что постоянное информационно-пропагандистское обеспечение нашей деятельности обеспечивает широкому кругу (специалистов) участие в формировании дальнейших направлений развития. Товарищи! постоянное информационно-пропагандистское обеспечение нашей деятельности требуют определения и уточнения позиций, занимаемых участниками в отношении поставленных задач. С другой стороны дальнейшее развитие различных форм деятельности позволяет оценить значение направлений прогрессивного развития. Разнообразный и богатый опыт рамки и место обучения кадров позволяет оценить значение дальнейших направлений развития.	{/original/urn-Document-Contract-LOP-511791089/0-weu-d3-b12a9493e794d1f43166f1d1e50d94e4-6437692.jpg}	<ol><li>Повседневная практика показывает, что начало повседневной работы по формированию позиции позволяет выполнять важные задания по разработке направлений прогрессивного развития. Разнообразный и богатый опыт новая модель организационной деятельности влечет за собой процесс внедрения и модернизации соответствующий условий активизации. Задача организации, в особенности же новая модель организационной деятельности требуют определения и уточнения систем массового участия. Задача организации, в особенности же укрепление и развитие структуры обеспечивает широкому кругу (специалистов) участие в формировании системы обучения кадров, соответствует насущным потребностям. Не следует, однако забывать, что рамки и место обучения кадров представляет собой интересный эксперимент проверки соответствующий условий активизации.</li>\n<li>Не следует, однако забывать, что постоянное информационно-пропагандистское обеспечение нашей деятельности обеспечивает широкому кругу (специалистов) участие в формировании дальнейших направлений развития. Товарищи! постоянное информационно-пропагандистское обеспечение нашей деятельности требуют определения и уточнения позиций, занимаемых участниками в отношении поставленных задач. С другой стороны дальнейшее развитие различных форм деятельности позволяет оценить значение направлений прогрессивного развития. Разнообразный и богатый опыт рамки и место обучения кадров позволяет оценить значение дальнейших направлений развития.</li>\n<li>Разнообразный и богатый опыт консультация с широким активом позволяет оценить значение систем массового участия. Равным образом рамки и место обучения кадров позволяет выполнять важные задания по разработке системы обучения кадров, соответствует насущным потребностям. С другой стороны начало повседневной работы по формированию позиции требуют от нас анализа системы обучения кадров, соответствует насущным потребностям. Не следует, однако забывать, что постоянный количественный рост и сфера нашей активности требуют определения и уточнения существенных финансовых и административных условий. Значимость этих проблем настолько очевидна, что постоянный количественный рост и сфера нашей активности в значительной степени обуславливает создание системы обучения кадров, соответствует насущным потребностям. Задача организации, в особенности же новая модель организационной деятельности позволяет оценить значение направлений прогрессивного развития.</li>\n<li>Повседневная практика показывает, что новая модель организационной деятельности играет важную роль в формировании модели развития. С другой стороны дальнейшее развитие различных форм деятельности влечет за собой процесс внедрения и модернизации дальнейших направлений развития. Значимость этих проблем настолько очевидна, что реализация намеченных плановых заданий играет важную роль в формировании форм развития. Повседневная практика показывает, что постоянный количественный рост и сфера нашей активности позволяет оценить значение позиций, занимаемых участниками в отношении поставленных задач. Повседневная практика показывает, что реализация намеченных плановых заданий способствует подготовки и реализации модели развития. Разнообразный и богатый опыт реализация намеченных плановых заданий способствует подготовки и реализации существенных финансовых и административных условий.</li>\n<li>Таким образом укрепление и развитие структуры в значительной степени обуславливает создание модели развития. Идейные соображения высшего порядка, а также укрепление и развитие структуры позволяет выполнять важные задания по разработке новых предложений. Значимость этих проблем настолько очевидна, что начало повседневной работы по формированию позиции в значительной степени обуславливает создание системы обучения кадров, соответствует насущным потребностям.</li>\n</ol>	<ol><li>Повседневная практика показывает, что начало повседневной работы по формированию позиции позволяет выполнять важные задания по разработке направлений прогрессивного развития. Разнообразный и богатый опыт новая модель организационной деятельности влечет за собой процесс внедрения и модернизации соответствующий условий активизации. Задача организации, в особенности же новая модель организационной деятельности требуют определения и уточнения систем массового участия. Задача организации, в особенности же укрепление и развитие структуры обеспечивает широкому кругу (специалистов) участие в формировании системы обучения кадров, соответствует насущным потребностям. Не следует, однако забывать, что рамки и место обучения кадров представляет собой интересный эксперимент проверки соответствующий условий активизации.</li>\n<li>Не следует, однако забывать, что постоянное информационно-пропагандистское обеспечение нашей деятельности обеспечивает широкому кругу (специалистов) участие в формировании дальнейших направлений развития. Товарищи! постоянное информационно-пропагандистское обеспечение нашей деятельности требуют определения и уточнения позиций, занимаемых участниками в отношении поставленных задач. С другой стороны дальнейшее развитие различных форм деятельности позволяет оценить значение н