787990466	20354926	47836635	1117149226	115997801	10341110	1642094893	undefined	{1024206712}	{1118804000,1816416714}	\N	Александровка	2016-03-01	2	\N	50000.00	Donec ac finibus eros, ac vehicula eros. Sed vel rhoncus nunc. Nulla rhoncus semper orci sit amet eleifend. In ac felis at tellus vehicula varius. Suspendisse potenti. Maecenas quis nisi id nulla semper posuere eu at justo. Aliquam rutrum cursus finibus. Nulla at risus nec tellus iaculis tristique. Aenean sapien mi, consectetur ac elit nec, fermentum ullamcorper ex. Donec ornare aliquam vestibulum. Fusce faucibus eu erat ut pretium. Vivamus dui velit, aliquam sed feugiat ut, pretium in mauris.	{/original/urn-Document-Contract-RSS-787990466/moda-4943321.jpg}	<p>(1) ТОВ «_______________» (надалі - "Замовник"), в особі директора___________, який діє на підставі Статуту та<br />(2) ТОВ “ХФК” БІОКОН” (надалі - "Виконавець"), в особі Директора Павлової Віри Валеріївни, яка діє на підставі Статуту.<br />ЗАМОВНИК І ВИКОНАВЕЦЬ В ПОДАЛЬШОМУ ІМЕНУЮТЬСЯ РАЗОМ ЯК "СТОРОНИ" ТА КОЖЕН ОКРЕМО - "СТОРОНА".<br />ОСКІЛЬКИ</p>\n<p>ЗАМОВНИК бажає залучити ВИКОНАВЦЯ до надання послуг, пов’язаних з використанням аптечного складу, орендованого ЗАМОВНИКОМ у ВИКОНАВЦЯ,</p>\n<p>ЗАМОВНИК орендував у ВИКОНАВЦЯ склад з метою використання його як аптечного складу для зберігання лікарських засобів відповідно до Договору оренди нежитлових приміщень № ___________ від «__»________ 2015 р.</p>\n<p>ВИКОНАВЕЦЬ має значний досвід надання складських послуг та пов'язаних з<br />ними допоміжних послуг, та Сторони погодилися, що ВИКОНАВЕЦЬ надаватиме такі послуги ЗАМОВНИКУ на умовах, що викладені у цьому Договорі.</p>\n<p>ТАКИМ ЧИНОМ СТОРОНИ ДОМОВИЛИСЯ ПРО ТАКЕ:</p>	<ol><li>Визначення термінів<br />У цьому Договорі, якщо контекст нe вимагає іншого, наступні терміни мають такі значення:\n<ul><li>"Договір” означає цей договір, а також усі додатки та доповнення до нього, що будуть узгоджені та підписані Сторонами в процесі його виконання.</li>\n<li>"Дата початку” означає дату укладення цього Договору;</li>\n<li>"Клієнт" означає будь-яку особу або підприємство (товариство), які будуть отримувати Продукцію зі Складу на вимогу ЗАМОВНИКА;</li>\n<li>“НДП” означає Належну Дистриб'юторську Практику, як визначено у „Керівних<br />Принципах щодо Належної Дистриб'юторської Практики у Галузі Медичної Продукції, Призначеної для Вживання Людьми (94/С 63/03)";</li>\n<li>“Ліцензійні умови” означають Ліцензійні умови провадження господарської діяльності з виробництва лікарських засобів, оптової, роздрібної торгівлі лікарськими засобами та Ліцензійні умови провадження господарської діяльності з імпорту лікарських засобів.</li>\n<li>"Продукція" означає лікарські засоби, наведені у Додатку 3, що час від часу змінюється ЗАМОВНИКОМ в односторонньому порядку у письмовій формі;</li>\n<li>"Упаковка Продукції" означає одиницю Продукції у вторинній упаковці, що вказана у реєстраційних документах відповідного лікарського засобу;</li>\n<li>"МС" означає митний склад ВИКОНАВЦЯ, з якого може поставлятися Продукція, яка придбавається ЗАМОВНИКОМ. Взаємовідносини щодо надання послуг зі зберігання Продукції на митному складі ВИКОНАВЦЯ регулюються договорами між ЗАМОВНИКОМ та компаніями-нерезидентами, що постачають відповідну Продукцію.</li>\n<li>"Послуги" означає Складські послуги та інші послуги, надання яких погоджено Сторонами в рамках цього Договору або будь-яких додаткових угод до нього;</li>\n<li>"Складські послуги" означає послуги, пов'язані з розвантаженням, отриманням, складуванням, зберіганням, відбором, та відвантаженням Продукції ВИКОНАВЦЕМ зі Складу, підготовка Продукції для відвантаження і для утилізації згідно з цим Договором та як це визначено у Додатку 1.</li>\n<li>"Територія" означає територію України;</li>\n<li>"Склад" означає склад ВИКОНАВЦЯ, розташований за адресою: 08320, Київська область, Бориспільський район, село Велика Олександрівка, вул. Бориспільська, 9, 08320, Україна;</li>\n<li>"Холодильна кімната" означає спеціальну зону Складу, що оснащена таким чином, що в ній може постійно підтримуватися температура від 2°C до 8°C та вологість повітря в межах від ___% до ___%</li>\n<li>"Звітний період" означає календарний місяць протягом якого надаються Послуги за цим Договором.</li>\n</ul></li>\n<li>Тлумачення\n<ul><li>Заголовки у цьому Договорі наведені лише заради зручності та не впливають на його тлумачення.</li>\n<li>Слова, наведені в однині, включають множину, та навпаки, а слова, наведені у чоловічому роді, включають жіночий та середній роди, та навпаки.</li>\n<li>Будь-які посилання на законодавство є посиланнями на таке законодавство, що діє на дату підписання цього Договору, включаючи будь-які зміни та нові редакції такого законодавства, що можуть прийматися час від часу.</li>\n<li>Додатки, що додаються до цього Договору, становлять частину<br />цього Договору. Керуючись ст. 213 Цивільного кодексу України, в тексті цього Договору і додатків до нього Сторони можуть встановлювати переважну юридичну силу окремих його норм (пунктів, статей, розділів, додатків) перед іншими з метою запобігання суперечностям в тлумаченні цього Договору і його додатків. Додатки, як і будь-яка інша переписка між Сторонами, переслані за допомогою факсу вважаються чинними за умови супроводження оригінальними документами протягом 3 (трьох) тижнів.</li>\n<li>Усі строки, зазначені в цьому Договорі, наведені без урахування вихідних та святкових днів, якщо зазначається про робочі чи банківські дні.</li>\n</ul></li>\n</ol>	<ol><li>Відповідно до умов цього Договору ВИКОНАВЕЦЬ зобов’язується надавати ЗАМОВНИКУ Складські послуги, а також інші погоджені Сторонами Послуги, відповідно до умов цього Договору, а ЗАМОВНИК зобов’язується приймати надані послуги та оплачувати їх відповідно до умов цього Договору.  </li>\n<li>В рамках діяльності за цим Договором, зокрема щодо замовлення, контролю якості надання та приймання Послуг ВИКОНАВЦЯ, ЗАМОВНИК, шляхом видачі відповідного  наказу Директора ЗАМОВНИКА, призначає свою Уповноважену особу (надалі – Представник ЗАМОВНИКА). ЗАМОВНИК повідомляє ВИКОНАВЦЯ про призначення Представника ЗАМОВНИКА у момент підписання цього Договору. ЗАМОВНИК повідомляє ВИКОНАВЦЯ про зміну  Представника ЗАМОВНИКА у процесі виконання цього Договору за 7 (сім) календарних днів до фактичної заміни Представника ЗАМОВНИКА.</li>\n<li>За цим Договором Представник ЗАМОВНИКА  має всі права, що надані ЗАМОВНИКУ за цим Договором, включаючи, але не обмежуючись правом доступу до Складу у будь-який час, надавати вказівки та інструкції Виконавцю відповідно до Ліцензійних умов, надавати замовлення на Послуги, здійснювати контроль їх якості відповідно до умов цього Договору та законодавства України, тощо.</li>\n</ol>	<ol><li>ВИКОНАВЕЦЬ від свого імені надає  ЗАМОВНИКУ,  за вимогою останнього, Послуги згідно з цим Договором, починаючи від Дати початку.<br />ВИКОНАВЕЦЬ докладає всіх зусиль для виконання зобов'язань щодо надання Послуг. ВИКОНАВЕЦЬ зобов'язується надавати Послуги з належною старанністю та дбайливістю, сумлінно та ефективно, та відповідно до інструкції (стандартних операційних процедур - СОП) щодо проведення операцій на складі, затверджених ЗАМОВНИКОМ та будь-яких інструкцій та протоколів, які ЗАМОВНИК може надавати ВИКОНАВЦЮ час від часу. Сторони можуть також спільно погоджувати необхідні СОПи.     </li>\n<li>ВИКОНАВЕЦЬ зберігає Продукцію на Складі згідно з цим Договором відповідно до чинного законодавства України. ВИКОНАВЕЦЬ несе особисту та виключну відповідальність за дотримання всіх положень чинного законодавства, що діє в Україні, що регулюють надання Послуг за цим Договором.<br />Положення цього Договору щодо відповідальності Виконавця за збереження Продукції не протирічять умовам Договору оренди нежитлових приміщень № ______ від «___» ______ 2015 р., згідно якого Замовник орендує приміщення Складу у Виконавця, а Виконавець залишається відповідальним за збереження Продукції Замовника.</li>\n<li>ВИКОНАВЕЦЬ дотримується всіх інструкцій, наданих з боку ЗАМОВНИКА щодо умов зберігання, а також будь-яких інструкцій щодо зберігання, що зазначені на упаковці. ВИКОНАВЕЦЬ зберігатиме Продукцію у зоні Складу, призначеній для такого виду Продукції відповідно до цього Договору та вимог ЗАМОВНИКА.</li>\n<li>ВИКОНАВЕЦЬ забезпечує, щоб Продукція, призначена для зберігання при низькій температурі (як це визначено у Додатку 1), завжди зберігалася у Холодильній кімнаті у визначеній для ЗАМОВНИКА зоні на Складі - при температурі між +2°С та +8°С, та щоб ця Продукція ніколи не зберігалась при температурі 0°С або нижче 0°С (не заморожувалася). Умови Холодильної кімнати перевіряються та контролюються кожного дня персоналом ВИКОНАВЦЯ та візуються Представником ЗАМОВНИКА кожного дня.<br /><ol><li>ВИКОНАВЕЦЬ забезпечує  реєстрацію  температури за допомогою температурних  датчиків для звичайного зберігання 1 раз на 2 години та для холодного зберігання – 1 раз на годину. Протягом доби інформація від датчиків фіксується на комп’ютерному обладнанні ВИКОНАВЦЯ і у вигляді звіту надсилається ЗАМОВНИКУ вранці, наступного робочого дня, а після вихідних та святкових днів – в перший після них робочий день за весь період, що пройшов від останнього звіту.</li>\n</ol></li>\n<li>ВИКОНАВЕЦЬ забезпечує, щоб Продукція відвантажувалася зі Складу Клієнтам відповідно до інструкцій, отриманих від ЗАМОВНИКА, умов цього Договору та Додатку 1.  </li>\n<li>ЗАМОВНИК за участю та за сприянням персоналу ВИКОНАВЦЯ проводить інвентаризацію наявної на складі Продукції:\n<ol><li>Один раз на квартал проводиться повна інвентаризація наявної на складі Продукції;</li>\n<li>Один раз на місяць Представником ЗАМОВНИКА проводиться вибіркова (часткова) інвентаризація Продукції, наявної на Складі.</li>\n</ol></li>\n<li>Щодо інших питань проведення перевірок Складу та інвентаризації Продукції Сторони будуть керуватися положеннями Додатку 4 до цього Договору.</li>\n<li>Персонал ВИКОНАВЦЯ під керівництвом Представника ЗАМОВНИКА перевіряє кожну упаковку  Продукції на момент її отримання на Склад відповідно до умов, викладених у Додатку 1.</li>\n<li>ВИКОНАВЕЦЬ зобов’язується поводитися з Продукцією таким чином, щоб зберегти її від будь-яких втрат та пошкоджень під час переміщення з МС на Склад, зберігання на Складі, перевезення та виконання операцій з Продукцією відповідно до цього Договору. ВИКОНАВЕЦЬ несе відповідальність за будь-яке пошкодження або втрату Продукції (зокрема, без обмежень, за ті, що сталися внаслідок недбалого зберігання та/або вантажних робіт, або зберігання та/або вантажних робіт, що проводилися не відповідно до умов цього Договору), крім випадків, коли такі втрати чи пошкодження зумовлені обставинами непереборної сили.<br />ВИКОНАВЕЦЬ відшкодовує ЗАМОВНИКУ вартість Продукції, що стає непридатною внаслідок пошкоджень. Для цілей цього Договору вартість заміни має базуватись на собівартості Продукції (з урахуванням витрат на термінове транспортування та доставку Продукції що підлягає заміні) відповідно до даних бухгалтерського обліку ЗАМОВНИКА.</li>\n<li>ВИКОНАВЕЦЬ несе відповідальність за будь-які пошкодження Продукції, в т.ч. первинної і вторинної упаковки,     що     сталися     внаслідок недбалого ставлення до  наведених вище зобов'язань     або     будь-яких     дій,     що проводилися не відповідно до умов цього Договору. Крім   того,   ВИКОНАВЕЦЬ   негайно відшкодовує ЗАМОВНИКУ, на його вимогу, всі прямі витрати, видатки та зобов'язання (що включають додаткові витрати, видатки та зобов'язання, зазнані та/або понесені ЗАМОВНИКОМ при укладанні альтернативних угод щодо отримання послуг, що мали бути наданими ВИКОНАВЦЕМ), зазнані та/або понесені ЗАМОВНИКОМ у результаті ненадання ВИКОНАВЦЕМ Послуг згідно з умовами цього Договору. ЗАМОВНИК докладає всіх розумних зусиль   для   пом'якшення таких прямих витрат, видатків та зобов'язань.</li>\n<li>Згідно цього Договору, на письмовий запит ЗАМОВНИКА ВИКОНАВЕЦЬ може надавати також інші послуги, пов’язані з Послугами, або Послуги в додатковому до визначеного цим Договором обсязі. Вартість таких додаткових послуг погоджується відповідно до Додатку 2.</li>\n<li>ВИКОНАВЕЦЬ зобов’язується не діяти жодним таким способом, який би міг викликати порушення ЗАМОВНИКОМ своїх зобов’язань за Договором оренди нежитлових приміщень № ____________ від «_____» _________ 2015 р., а також забезпечити, щоб його працівники та інші особи, що діють від імені ВИКОНАВЦЯ, також не діяли таким чином.</li>\n<li>Залучення ВИКОНАВЦЕМ субпідрядників не впливає на дійсність зобов’язань ВИКОНАВЦЯ щодо надання ЗАМОВНИКУ Послуг за цим Договором. У разі залучення субпідрядників ВИКОНАВЕЦЬ залишається відповідальним перед ЗАМОВНИКОМ за якість наданих ними Послуг. У випадках, передбачених у цьому Договорі, ВИКОНАВЕЦЬ може залучати лише тих субпідрядників, які були належним чином погоджені з ЗАМОВНИКОМ.</li>\n</ol>	<ol><li>ЗАМОВНИК  сплачує ВИКОНАВЦЮ винагороду за Послуги відповідно до Додатку 2 та Статті 5 цього Договору.               </li>\n<li>ЗАМОВНИК надаватиме ВИКОНАВЦЮ передбачену цим Договором документацію та інформацію для забезпечення можливості надання Послуг. </li>\n<li>ЗАМОВНИК   гарантує,    що    вся    Продукція,    що надходить     на     Склад,      зареєстрована Міністерством охорони здоров'я України (його відповідними підрозділами).</li>\n<li>ЗАМОВНИК   несе   відповідальність  за витрати щодо будь-яких поставок Продукції, що можуть бути затримані державними органами для цілей тестування.</li>\n<li>ЗАМОВНИК  інформує   ВИКОНАВЦЯ   про   свої   наміри щодо    розпорядження     Продукцією,  що зберігається на Складі, не пізніше ніж за 1 місяць  до   закінчення  строку придатності Продукції.</li>\n<li>ЗАМОВНИК інформує ВИКОНАВЦЯ про  самостійне вивезення Продукції Клієнтами, або перевізниками (транспортними організаціями).</li>\n<li>ЗАМОВНИК має право проводити перевірки та інвентаризації Продукції на Складі. Проведення перевірок та інвентаризацій може проводитися ЗАМОВНИКОМ самостійно у будь-який зручний час за вибором ЗАМОВНИКА. Для проведення перевірки ЗАМОВНИКОМ можуть залучатися треті особи, зокрема представники головного офісу материнської компанії ЗАМОВНИКА, уповноважені особи державних органів, аудиторських компаній, залучених Замовником незалежних організацій, в тому числі суб’єктів оціночної діяльності тощо, за виключенням конкурентів ВИКОНАВЦЯ у сфері складських послуг. Про проведення перевірок із залученням таких третіх осіб ЗАМОВНИК попереджає  ВИКОНАВЦЯ не пізніше як за 10 (десять) календарних днів до дати перевірки.</li>\n</ol>	<ol><li>Винагорода за Послуги, що надаються ВИКОНАВЦЕМ ЗАМОВНИКУ за цим  Договором визначається відповідно до Додатку 2 до цього Договору. Винагорода за надання Послуг визначається виходячи з об’єму фактично наданих Послуг ВИКОНАВЦЕМ за звітний період.</li>\n<li>Винагорода за Послуги виплачується ЗАМОВНИКОМ ВИКОНАВЦЮ у гривнях протягом 10 (десяти) календарних днів з моменту отримання для підписання акту приймання-передачі наданих Послуг за відповідний Звітний період та на підставі рахунку-фактури, що складається та виставляється ВИКОНАВЦЕМ разом з таким Актом.        </li>\n<li>У випадку, якщо на день складання Виконавцем акту приймання-передачі наданих Послуг офіційний курс обміну гривні на долар США, встановлений НБУ (після 14:00 на дату, що передує даті складання такого Акту), зміниться по відношенню до зафіксованого в п. 1 Додатку 2 до даного Договору більше ніж на_5 %, сума винагороди за Послуги підлягає коригуванню за наступною формулою:<br />де:<br />S=S0*r/r0<br />S - відкоректована сума винагороди;<br />S0 - сума сплати відповідно п.1 Додатку 2 даного Договору ;<br />r    - курс обміну гривні на долар США, встановлений НБУ (після 14:00 на дату, що передує даті складання такого Акту); <br />r0  - курс обміну гривні на долар США,  зафіксований в п.1 Додатку 2 даного Договору .</li>\n<li>Розмір винагороди може змінюватись за погодженням Сторін у письмовій формі.</li>\n</ol>	<ol><li>ЗАМОВНИК   може (але не зобов’язаний)  страхувати Продукцію   своїм власним      коштом  від  втрати або пошкодження внаслідок  пожежі, повені, крадіжки та таких інших ризиків, які можуть вважатися доцільними ЗАМОВНИКОМ, що не скасовує і не зменшує зобов’язань ВИКОНАВЦЯ згідно статей 3 та 8. </li>\n<li>ВИКОНАВЕЦЬ страхує та підтримує страхування відповідно до стандартів, що діють у цій галузі, щодо будівлі Складу, включаючи (без обмеження) страхування від пожежі, повені, крадіжки, відповідальності перед третіми особами та інших ризиків на умовах „Всі ризики”     Копія   відповідного страхового    полісу    та    документу,    що підтверджує   сплату   ВИКОНАВЦЕМ  останньої страхової   премії   щодо   такої   страховки, надається ЗАМОВНИКУ ВИКОНАВЦЕМ на вимогу ЗАМОВНИКА.</li>\n</ol>	<ol><li>ВИКОНАВЕЦЬ та ЗАМОВНИК погоджуються вести точний облік Продукції, яка знаходиться на Складі. На вимогу ЗАМОВНИКА Сторони проводитимуть звірку даних обліку. ЗАМОВНИК підтримує ефективний порядок відстеження партій та повернення Продукції від Клієнтів ЗАМОВНИКА.</li>\n<li>Якщо у будь-який час ЗАМОВНИК вважає, що будь-яка партія або партії Продукції з будь-якої причини мають бути повернені та/або вилучені у ВИКОНАВЦЯ або Клієнта ЗАМОВНИКА. ЗАМОВНИК компенсує ВИКОНАВЦЮ узгоджені витрати, що можуть виникнути внаслідок вимоги повернути (вилучити) Продукцію зі Складу, якщо здійснення такої дії вимагається ЗАМОВНИКОМ або відповідними органами влади Території.      </li>\n</ol>	<ol><li>ВИКОНАВЕЦЬ погоджується, що всі знаки для товарів, пов'язані з Продукцією, завжди залишаються у виключній власності ЗАМОВНИКА. ВИКОНАВЕЦЬ проводитиме пакування та передпродажну підготовку Продукції відповідно до умов цього Договору та вимог ЗАМОВНИКА.</li>\n</ol>	<ol><li>В тій мірі, в якій  Сторонам  необхідно розкрити інформацію іншій Стороні з тим, щоб вона могла виконувати свої зобов'язання за цим Договором, ЗАМОВНИК та ВИКОНАВЕЦЬ вважають таку інформацію своєю конфіденційною власністю або інформацією, яка іншим чином законно дозволена для розкриття іншій Стороні згідно з умовами суворої конфіденційності. <br />Відповідно, кожна Сторона утримує всю інформацію, розкриту їй, згідно з умовами суворої конфіденційності, та докладає таких самих зусиль для уникнення будь-якого несанкціонованого використання або розкриття такої інформації, яких вона докладає для захисту своєї власної інформації, що має характер конфіденційної; за умови, що обов'язок Сторін щодо утримання конфіденційності за цим Договором не поширюється на інформацію, яку Сторони можуть показати, як таку: <br /><ul><li>що є або була опублікованою інформацією, яка стала загальнодоступною на Території іншим чином, ніж шляхом порушення ними своїх зобов’язань за цим Договором;</li>\n<li>що  знаходиться  або  після  укладання цього Договору була законно отримана у володіння Сторони  іншим чином, ніж від іншої Сторони або Сторони, що отримала,    прямо або опосередковано, таку інформацію  від будь-якої Сторони як  конфіденційну;<br />або</li>\n<li>розкриття якої законно вимагається відповідними  органами  влади за законом.</li>\n</ul></li>\n<li>Положення цієї статті продовжуватимуть діяти і після припинення терміну дії цього Договору з будь-якої причини протягом 6 (шести) років.    </li>\n</ol>	<ol><li>Цей Договір набуває чинності на Дату початку та залишається чинним, враховуючи положення наведених нижче статей   11.2, 11.3 та 11.4, до «__» _________ 201__ року. Строк дії даного Договору може бути продовжений за ініціативою ЗАМОВНИКА на строк до 2-х років, шляхом подачі заявки ВИКОНАВЦЮ не пізніше ніж за 3 місяці до закінчення строку  Договору з наступним підписанням відповідного Додатку до Договору.  </li>\n<li>Незважаючи на викладене вище, будь-яка Сторона може в односторонньому порядку припинити термін дії цього Договору або шляхом надання письмового повідомлення іншій Стороні за 3 (три) місяці до дати припинення Договору, або, з урахуванням підпункту 11.5(b), у відповідний строк, якщо:<br /><ul><li>інша Сторона припускається будь-якого порушення умов цього Договору та не виправляє таке порушення протягом 30 днів з моменту отримання письмового повідомлення від іншої Сторони; або</li>\n<li>щодо будь-якої Сторони розпочинається процес банкрутства або ліквідації.</li>\n</ul></li>\n<li>У разі істотної зміни (як визначено нижче) структури правової або дійсної власності ВИКОНАВЦЯ або суттєвої зміни у характері його господарської діяльності у порівнянні з тим станом, що існував на дату підписання цього Договору, які, на виключний розсуд ЗАМОВНИКА, є значними, ЗАМОВНИК має право негайно або, з урахуванням підпункту 11.5(b), у відповідний строк в односторонньому порядку розірвати цей Договір та припинити дію цього Договору шляхом надання письмового повідомлення. В такому випадку додаткового погодження від ВИКОНАВЦЯ не вимагається, а Договір вважається розірваним / припиненим через 14 календарних днів з моменту отримання такого письмового повідомлення, якщо в тексті повідомлення не визначений інший більш тривалий строк.<br />Для цілей цього пункту 11.3. «істотна зміна» означає будь-яку зміну в керівному персоналі, що відповідає за вчинення документів або уповноважений затверджувати документи від імені Сторони, порушення статті 10 цього Договору щодо передачі або розкриття конфіденційної інформації Замовника.</li>\n<li>ЗАМОВНИК матиме право в односторонньому порядку достроково припинити дію цього Договору також у будь-який час без обґрунтування причин такого припинення шляхом надання ВИКОНАВЦЮ письмового повідомлення не менш ніж за 3 місяці до бажаної дати припинення.</li>\n<li>Після повідомлення про припинення   дії  цього   Договору  з будь-якої причини:\n<ul><li>ВИКОНАВЕЦЬ негайно повертає та/або, на вимогу ЗАМОВНИКА, знищує всю конфіденційну інформацію на відповідних носіях;</li>\n<li>ВИКОНАВЕЦЬ, за вказівкою ЗАМОВНИКА, продовжує надавати Послуги протягом періоду, визначеного ЗАМОВНИКОМ, але не довше 3 місяців після повідомлення про припинення терміну дії цього Договору, та, згідно з інструкціями ЗАМОВНИКА, ВИКОНАВЕЦЬ  негайно повертає ЗАМОВНИКУ або, на розсуд ЗАМОВНИКА, особі, призначеній ним, всю Продукцію, що знаходиться на Складі. Крім випадків, коли Договір припиняється через порушення з боку ВИКОНАВЦЯ, ЗАМОВНИК несе обґрунтовані транспортні витрати, пов'язані з перевезенням зі Складу на іншу визначену Замовником адресу;</li>\n<li>ВИКОНАВЕЦЬ     передає    ЗАМОВНИКУ    або    його призначеному представнику всю дозвільну документацію, що стосується Продукції, яку він отримав на своє ім'я та які можуть бути передані, а ЗАМОВНИК, крім випадків, коли Договір припиняється через порушення з боку ВИКОНАВЦЯ, несе всі розумні витрати ВИКОНАВЦЯ, пов'язані з такою передачею; та</li>\n<li>ВИКОНАВЕЦЬ зберігає свої бухгалтерські книги та інші записи,  пов'язані    з    Послугами, та на вимогу ЗАМОВНИКА зобов’язаний надавати до них доступ для перевірки ЗАМОВНИКОМ протягом дії цього Договору.<br />У випадку, якщо ВИКОНАВЕЦЬ не виконує всі чи будь-які з умов, що викладені в цій Статті 11.5, ВИКОНАВЕЦЬ сплачує на користь ЗАМОВНИКА неустойку у розмірі ціни на всю Продукцію, що зберігається на Складі після закінчення періоду, що зазначений в підпункті «b» цієї Статті 11.5, вказану у відповідних рахунках.</li>\n</ul></li>\n<li>Жодна компенсація не сплачується жодною із Сторін виключно внаслідок припинення  дії  цього  Договору  згідно  з цією статтею 11.</li>\n</ol>	<p>Жодна Сторона не несе відповідальність за невиконання або невчасне виконання своїх відповідних зобов'язань за цим Договором, що сталося внаслідок причин, що знаходяться поза межами її розумного контролю, включаючи, але не обмежуючись цим, війну, страйк (працівників інших, ніж власні працівники відповідної Сторони), заколоти, дії уряду, за умови, що Сторона, яка зазнала такого впливу, надала іншій Стороні письмове повідомлення протягом 30 (тридцяти) днів із зазначенням моменту початку та закінчення дії таких обставин. Свідоцтво,     видане      торгово-промисловою палатою або іншим відповідним органом країни, в якій виникли такі обставини, є достатнім доказом існування таких обставин та їхньої тривалості. Час, передбачений для повного виконання зобов'язань Стороною, що підпала під вплив таких обставин, продовжується на період, що дорівнює тривалості таких обставин. Якщо такі обставини існують більше 2 (двох) місяців, будь-яка Сторона має право в односторонньому порядку припинити дію цього Договору негайно шляхом надання письмового повідомлення іншій Стороні без будь-якої подальшої відповідальності.  </p>	<p>Жодні бездіяльність або утримання від будь-яких дій з боку ЗАМОВНИКА, прямі або опосередковані, щодо примусового застосування будь-яких своїх прав за цим Договором, не повинні вважатись відмовою від таких прав та не впливають на можливість примусово застосовувати такі права у майбутньому.</p>	<p>Цей Договір з усіма Додатками представляє собою повну домовленість між Сторонами щодо предмету цього Договору та позбавляє чинності всі попередні угоди, переговори та зобов'язання щодо цього. Якщо будь-який суд або компетентний орган визнає будь-яке положення цього Договору не чинним або незаконним, повністю або частково, інші положення та, в залежності від випадку, решта такого положення, продовжують бути чинними. </p>	<p>Цей Договір укладено українською мовою, у двох оригінальних примірниках, по одному – для кожної із Сторін.  </p>	<ol><li>Цей Договір регулюється та тлумачиться відповідно до норм матеріального права України.</li>\n<li>Сторони за цим Договором намагаються вирішувати будь-які спори шляхом дружніх переговорів. У разі, якщо така спроба не дає результатів, будь-який спір, що виникає з або у зв'язку з цим Договором передається на розгляд та остаточно вирішується відповідним господарським судом України.    </li>\n</ol>	<ol><li>Всі заголовки в тексті цього Договору використовуються тільки для зручності при користуванні його текстом і не повинні враховуватися для цілей його тлумачення.</li>\n<li>Сторони підтверджують, що вони мають всі належні повноваження, дозволи та ліцензії, що необхідні для укладення та належного виконання цього Договору.<br />НА ЗАСВІДЧЕН