.</li>\n<li>Передача оборудования на техническое обслуживание производится после подписания настоящего договора, утверждения графика проведения работ (Приложение 2).</li>\n<li>Работы не указанные в приложении №3, запасные части холодильного оборудования, а также ремонт оборудования, вышедшего из строя по вине Заказчика или по  причине нормального (естественного) износа, в стоимость технического обслуживания  не входит и оплачивается Заказчиком по отдельному счету.</li>\n<li>Уведомлением о наличии неисправности является факсимильное сообщение (с 9.00 до 17.00) от ответственного лица Заказчика (п.7.1.) с указанием наименования оборудования, описание выявленной неисправности, времени проявления неисправности оборудования.</li>\n</ol>	<ol><li>Разрабатывает график технического обслуживания (Приложение №2) и согласовывает их с Заказчиком.</li>\n<li>Выполняет полный объем работ согласно п.1.2. настоящего договора.</li>\n<li>Проводит инструктаж ответственных представителей Заказчика по правилам эксплуатации оборудования и осуществляет контроль за их выполнением в период проведения технического обслуживания и ремонта оборудования.</li>\n<li>Составляет соответствующие аварийные акты, предписания в случае нарушения Заказчиком правил эксплуатации оборудования и техники безопасности, а также невыполнении мероприятий (строительных, изоляционных, сантехнических, электромонтажных и др.) обеспечивающих работу оборудования в соответствии с эксплуатационной  документацией.          </li>\n<li>С момента уведомлении согласно п.1.6. направить для устранения неисправности компетентного работника в срок, не более тридцати шести часов (при уведомлении с 17.00 до 8.00 в рабочие дни и с 00.00 до 24.00 в выходные и праздничные дни) и не более двадцати четырех часов (при уведомлении с 8.00 до 17.00 в рабочие дни). В течение 24-х часов с момента прибытия к месту ремонта установить причину неисправности и устранить ее собственными силами (при наличии вышедшего из строя элемента в ЗИПе у Заказчика или на складе у Исполнителя). В противном случае время устранения неисправности увеличивается на срок поставки запчастей, но не более чем на 4 недель (при поставке из-за рубежа).</li>\n<li>Информирует Заказчика о неисправностях оборудования и наименовании запасных частей, требуемых для проведения ремонтных работ, и сроках их приобретения.</li>\n</ol>	<ol><li>Согласовывает с Исполнителем графики проведения технического обслуживания и контролирует их выполнение (Приложение №2).</li>\n<li>Обеспечивает эксплуатацию холодильной техники в соответствии с правилами эксплуатации оборудования.</li>\n<li>При эксплуатации оборудования обеспечивает соблюдение установленных правил по охране труда, техники безопасности и санитарии.</li>\n<li>Закрепляет оборудование за ответственным представителем, отвечающим за его правильную эксплуатацию и использование по назначению. </li>\n<li>Не допускает к эксплуатации оборудования лиц, не прошедших обучение по работе с оборудованием, а также инструктаж по технике безопасности.</li>\n<li>Выполняет предписания Исполнителя, связанные с соблюдением правил эксплуатации и техники безопасности, а также с выполнением работ, не предусмотренных в Статье 2 данного договора, но необходимых для нормальной работы оборудования (строительные, изоляционные, сантехнические, электромонтажные и др.)</li>\n<li>В установленном порядке осуществляет приемку оборудования по качеству, привлекая к этой работе представителей Исполнителя, а также уведомляет о выявленных недостатках в работе оборудования.</li>\n<li>Обеспечивает сохранность эксплуатационной и другой нормативно-технической документации на оборудование.</li>\n<li>Приобретает комплект ЗИП (Запчасти, Инструмент, Приспособления), согласованный с Исполнителем.</li>\n<li>Производит оплату согласно п.4.2, 4.4.</li>\n</ol>	<ol><li>Оплата за работы по техническому обслуживанию осуществляется согласно Приложения №1.</li>\n<li>Работы по техническому обслуживанию оплачиваются Заказчиком путем перечисления полагающейся суммы на расчетный счет Исполнителя. Оплата по факту выполнения работ по выставленному счету, в течении пяти дней с момента подписания Акта выполненных работ за техническое обслуживание.</li>\n<li>Работы, выполняемые по просьбе Заказчика и не вошедшие в настоящий договор (например, модернизация, перенос оборудования и др.), считаются дополнительными.</li>\n<li>Оплата за дополнительные работы и запасные части, производятся по мере выполнения этих работ путем выставления Исполнителем счетов с приложением актов приемки выполненных работ. Срок оплаты – пять дней с даты выставления счета за дополнительные работы и запасные части.  </li>\n</ol>	<ol><li>При просрочке Заказчиком платежей по п.4.2 и п.4.4 настоящего договора, Заказчик уплачивает Исполнителю штраф в размере двойной учетной ставки НБУ за каждый день просрочки от суммы просроченного платежа. При просрочке платежей по п.4.2 и п.4.4 на один месяц Исполнитель вправе расторгнуть договор в одностороннем порядке.</li>\n<li>В случае «ложного» вызова на устранение неисправности оборудования, Заказчик уплачивает Исполнителю  накладные и транспортные расходы. </li>\n<li>В случае неявки компетентного работника Исполнителя для проведения технического обслуживания в срок, установленный графиком, Исполнитель уплачивает Заказчику штраф в размере месячной стоимости технического обслуживания  за единицу оборудования, по которой не произведено обслуживание в срок установленный графиком. Штраф не выплачивается, если Исполнитель предварительно согласовал с Заказчиком изменение графика.   </li>\n<li>В случае неявки компетентного работника Исполнителя для устранения причины неисправности (см. п. 1.6.) в срок и при условиях оговоренных в п. 2.5., Исполнитель уплачивает Заказчику штраф в размере месячной стоимости технического обслуживания  за единицу оборудования, по которой не произведено устранение причины неисправности.</li>\n<li>Исполнитель устанавливает гарантию, в срок  действия договора, на качество выполненных работ.</li>\n<li>В тех случаях, когда оборудование выведено из строя в результате нарушения правил эксплуатации или нормального (естественного) износа ремонт производится за отдельную плату, за счет Заказчика.</li>\n<li>Гарантийные обязательства не выполняются в случае:\n<ul><li>оборудование эксплуатировалось при электропитании, которое по техническим характеристикам не соответствует ГОСТам, а равно при отсутствии или неправильном подключении устройств электрозащиты оборудования;</li>\n<li>оборудование пришло в негодность по причине его эксплуатации в условиях не соответствующих допустимым условиям эксплуатации, оговоренным в сопровождающей документации ;</li>\n<li>оборудование пришло в негодность по причине использования не рекомендованных масел, хладагентов, теплоносителей, промывочных жидкостей, герметиков и других химических жидкостей;</li>\n<li>оборудование пришло в негодность по причине загрязнения, абразивного износа, коррозии материалов, ненормальных вибраций, повреждений или аварий, случившихся по небрежности или недосмотру, либо вследствие ненадлежащего содержания, хранения или транспортировки;</li>\n<li>оборудование пришло в негодность в связи с вмешательством в конструкцию или попытке производства ремонта, несанкционированного Исполнителем.</li>\n</ul></li>\n<li>Исполнитель не несет ответственность, за ущерб нанесенный продукции Заказчика охлаждаемой холодильным и технологическим оборудованием, в случае, если ущерб наступил вследствие поломки оборудования, а также в случае возникновения у Заказчика прямого или косвенного ущерба вследствие поломки оборудования, кроме случаев неявки компетентного работника Исполнителя для устранения причины неисправности.</li>\n</ol>	<ol><li>В случае значительного повышения стоимости используемых расходных материалов и ремонтных работ на протяжении срока действия Договора, сторонами заключается дополнительное соглашение об увеличении оплаты за техническое обслуживание.</li>\n<li>В случае если стороны не достигли согласия по п.6.1., за Исполнителем остается право расторжения Договора, поставив в известность Заказчика об этом за 30 дней.</li>\n<li>Все  изменения  и дополнения к настоящему Договору будут считаться действительными и рассматриваться как его неотъемлемая часть, если они совершены в письменной форме, подписаны  уполномоченными представителями Сторон и содержат прямую ссылку на данный Договор.</li>\n<li>Настоящий договор может быть расторгнут Сторонами досрочно в одностороннем порядке:\n<ul><li>Заказчиком - в случае систематического невыполнения Исполнителем обязательств по настоящему договору. </li>\n<li>Исполнителем - в случае по п. 6.2 или систематической задержки Заказчиком  оплаты по п.4.2, п.4.4.</li>\n</ul></li>\n<li>Сторона, намеревающаяся расторгнуть договор, обязана письменно уведомить об этом другую Сторону не менее чем  за 30 дней. С момента истечения 30 дней  договор считается расторгнутым. </li>\n<li>В случае расторжения договора согласно п. 6.4. договора, ни одна из Сторон не несет ответственности за упущенную выгоду в результате  досрочного расторжения настоящего договора.</li>\n</ol>	<ol><li>По вопросам, связанным с выполнением обязательств по настоящему договору, стороны выделяют ответственных представителей:<br /><strong>От Заказчика: </strong>______________________  <br /><strong>От Исполнителя</strong>: ___________________</li>\n<li>В случае форс-мажорных обстоятельств, стихийных бедствий, пожара и т.д., повлекших за собой выход из строя оборудования, ремонт осуществляется за счет Заказчика за отдельную плату.</li>\n<li>Любые спорные вопросы разрешаются сторонами путем переговоров. Вопросы, по которым стороны не могут достичь согласия, решаются на основе действующего законодательства Украины.</li>\n<li>Настоящий Договор, с учетом приложений, составлен на семи страницах, в двух экземплярах, по одному для каждой из Сторон, каждый из которых имеет одинаковую силу. </li>\n</ol>	<p>Срок действия договора:</p>\n<p>начало             _____  _____________________<br />оконча