<li>Протягом наступного дня, якщо виклик здійснено після 12:00 години;</li>\n<li>Якщо у ЗАМОВНИКА є необхідність термінового приїзду спеціалістів ВИКОНАВЦЯ, то він може бути здійснений протягом поточного робочого дня або терміново при наявності незайнятих спеціалістів ВИКОНАВЦЯ на момент здійснення виклику;  </li>\n<li>Між особою ЗАМОВНИКА, що здійснила виклик, та особою ВИКОНАВЦЯ, що оформила замовлення, може бути досягнуто домовленість про перенос дати виконання замовлення на більш пізній термін.</li>\n</ol></li>\n<li>Технічне обслуговування виконується за місцем розташування устаткування й типом обслуговування, передбаченим п. 1 даного Договору протягом робочого часу Виконавця, на підставі замовлень ЗАМОВНИКА.</li>\n<li>Терміни і тривалість виконання робіт, необхідність яких виникла з ініціативи ЗАМОВНИКА, установлюються ВИКОНАВЦЕМ в залежності від типу робіт, які слід виконати і погоджується із Замовником в кожному окремому випадку та вказується у Додатках до Договору.</li>\n<li>Відомості про виконані роботи заносяться ВИКОНАВЦЕМ у журнал технічного обслуговування чи документ, що його заміняє, котрий ведеться ЗАМОВНИКОМ.</li>\n</ol>	<ol><li>Вартість робіт, технічному обслуговуванню Обладнання визначається на підставі фактично затраченого часу в годинах. Вартість однієї години робіт по технічному обслуговуванню фахівцем ВИКОНАВЦЯ за станом на “___” ____________ 20_ р. складає ___ грн. (_______гривень __ копійок), крім того ПДВ в розмірі згідно чинного законодавства на дату виникнення податкового зобов’язання за одну годину згідно діючих тарифів ВИКОНАВЦЯ.</li>\n<li>Оплата за технічне обслуговування здійснюється ЗАМОВНИКОМ після виконання робіт ВИКОНАВЦЕМ, відповідно до наданого рахунку та Акту приймання-передачі виконаних робіт, шляхом перерахування коштів на розрахунковий рахунок ВИКОНАВЦЯ.</li>\n<li>Рахунки надаються ЗАМОВНИКУ на протязі __ (____) робочих днів після виконання ВИКОНАВЦЕМ робіт по технічному обслуговуванню Облданання на підставі підписаного Сторонами акту виконаних робіт і мають бути сплачені  не пізніше ___ (_________) банківських днів після надання рахунку.  </li>\n</ol>	<ol><li>ЗАМОВНИК бере на себе зобов’язання:\n<ul><li>не допускати до обслуговування обладнання треті фірми без    узгодження із ВИКОНАВЦЕМ;</li>\n<li>виконувати рекомендації представника ВИКОНАВЦЯ з правильної експлуатації та збереження Обладнання;</li>\n<li>дотримуватись правил експлуатації Обладнання, встановлених виготовлювачем.</li>\n</ul></li>\n</ol><ol><li>ВИКОНАВЕЦЬ бере на себе зобов’язання  не розголошувати інформацію, до якої він отримає доступ під час роботи в ЗАМОВНИКА. </li>\n<li>ВИКОНАВЕЦЬ бере на себе зобов’язання усувати своїми силами та за власний рахунок недоліки виявлені в ході прийому-передачі виконаних робіт протягом ___ (______) робочих днів з моменту отримання повідомлення від ЗАМОВНИКА про виявлення таких недоліків.</li>\n</ol>	<ol><li>У випадку порушення зобов'язання, що виникає з цього Договору, Сторона несе відповідальність, визначену чинним в Україні законодавством.</li>\n<li>Усі спори, що виникають з цього Договору або пов'язані із ним, вирішуються шляхом переговорів між Сторонами.</li>\n<li>Якщо відповідний спір неможливо вирішити шляхом переговорів, він вирішується в судовому порядку за встановленою підвідомчістю та підсудністю такого спору відповідно до чинного в Україні законодавства.</li>\n<li>За порушення строків виконання робіт, вказаних у Додатках до Договору, ВИКОНАВЕЦЬ сплачує ЗАМОВНИКУ неустойку у розмірі подвійної облікової ставки НБУ за кожний день прострочення від суми невиконаного замовлення.</li>\n</ol>	<ol><li>Цей Договір вважається укладеним і набирає чинності з моменту його підписання Сторонами та його скріплення печатками Сторін.</li>\n<li>Строк цього Договору починає свій перебіг у момент, визначений у п. 6.1 цього Договору та закінчується “___” ______________201_ включно.</li>\n<li>У випадку, якщо жодна зі сторін за 30 днів до закінчення строку цього договору не повідомить іншу про припинення дії договору, він вважається пролонгованим на цих же умовах на наступний календарний рік. Ця умова може бути застосована неодноразово.</li>\n<li>Закінчення строку цього Договору не звільняє Сторони від відповідальності за його порушення, яке мало місце під час дії цього Договору.</li>\n<li>Якщо інше прямо не передбачено цим Договором або чинним в Україні законодавством, зміни у цей Договір можуть бути внесені тільки за домовленістю Сторін, яка оформлюється додатковою угодою до цього Договору.</li>\n<li>Зміни у цей Договір набирають чинності з моменту належного оформлення Сторонами відповідної додаткової угоди до цього Договору, якщо інше не встановлено у самій додатковій угоді, цьому Договорі або у чинному в Україні законодавстві.</li>\n<li>Якщо інше прямо не передбачено цим Договором або чинним в Україні законодавством, цей Договір може бути розірваний тільки за домовленістю Сторін, яка оформлюється додатковою угодою до цього Договору.</li>\n<li>Цей Договір вважається розірваним з моменту належного оформлення Сторонами відповідної додаткової угоди до цього Договору, якщо інше не встановлено у самій додатковій угоді, цьому Договорі або у чинному в Україні законодавстві.</li>\n</ol>	<ol><li>Усі правовідносини, що виникають з цього Договору або пов'язані із ним, у тому числі пов'язані із дійсністю, укладенням, виконанням, зміною та припиненням цього Договору, тлумаченням його умов, визначенням наслідків недійсності або порушення Договору, регламентуються цим Договором та відповідними нормами чинного в Україні законодавства, а також застосовними до таких правовідносин звичаями ділового обороту на підставі принципів добросовісності, розумності та справедливості.</li>\n<li>Після підписання цього Договору всі попередні переговори за ним, листування, попередні договори, протоколи про наміри та будь-які інші усні або письмові домовленості Сторін з питань, що так чи інакше стосуються цього Договору, втрачають юридичну силу, але можуть братися до уваги при тлумаченні умов цього Договору.</li>\n<li>Сторона несе повну відповідальність за правильність вказаних нею у цьому Договорі реквізитів та зобов'язується своєчасно у письмовій формі повідомляти іншу Сторону про їх зміну, а у разі неповідомлення несе ризик настання пов'язаних із ним несприятливих наслідків.</li>\n<li>Відступлення права вимоги та (або) переведення боргу за цим Договором однією із Сторін до третіх осіб допускається виключно за умови письмового погодження цього із іншою Стороною.</li>\n<li>Додаткові угоди та додатки до цього Договору є його невід'ємною частиною і мають юридичну силу у разі, якщо вони викладені у письмовій формі, підписані Сторонами та скріплені їх печатками.</li>\n<li>Всі виправлення за текстом цього Договору мають силу та можуть братися до уваги виключно за умови, що вони у кожному окремому випадку датовані, засвідчені підписами Сторін та скріплені їх печатками.</li>\n<li>Цей Договір складений при повному розумінні Сторонами його умов та термінології українською мовою у двох автентичних примірниках, які мають однакову юридичну силу, - по одному для кожної із Сторін.</li>\n<li>На момент укладення цього Договору ВИКОНАВЕЦЬ є платником податку на прибуток на загальних умовах.</li>\n</ol>	\N	Configuring	UPN:DMS:Contracts:Contract:90154	\N	{}	\N	urn:Actor:User:System:1	\N	t	f	f	f	\N	\N	1456669958	1456669958	{urn:Management:Post:Individual:1118804000,urn:Management:Post:Individual:1816416714}	\N	\N	\N	\N	\N	\N
